rlain-and-genie-garage-door-opener-sensor-eye-issue-troubleshooting/";s:6:"domain";s:16:"www.mc-doors.com";}}s:9:"sentences";a:59:{i:0;s:135:"Having your garage door light blink continuously is not only annoying its also a sign that there is something wrong with the mechanism.";i:1;s:68:"There are several reasons why your garage door opener is doing this.";i:2;s:119:"However the two most common reasons include a problem with the lock button and malfunctioning safety reversing sensors.";i:3;s:122:"Four flashes is the most common reason your opener lights may be flashing is because of your sensor eyes being misaligned.";i:4;s:125:"If an object has misaligned your sensor eyes then it breaks the electronic beam preventing the garage door to close properly.";i:5;s:44:"The door will stop and reverse back upwards.";i:6;s:82:"The light from the opener blinks 10 times to warn you about misaligned photo eyes.";i:7;s:128:"To fix this issue first locate the two photo eyes attached to your garage door and clean the lens using a soft microfiber cloth.";i:8;s:101:"Loosen the wing nut holding up the photo eye and adjust them until both sensors are properly aligned.";i:9;s:76:"To diagnose the issue check the openers LED light located on the motor unit.";i:10;s:81:"How the lights will flash will depend on the type of garage door opener you have.";i:11;s:92:"If you have a Liftmaster Chamberlain or Craftsman garage door opener that has one LED light.";i:12;s:148:"When you see your garage door opener lights flashing and the garage door will not close it could be the safety reversing sensors or the LOCK button.";i:13;s:76:"If there is a safety reversing sensor issue the main light s flash 10 times.";i:14;s:39:"Start with aligning the safety sensors.";i:15;s:137:"If your garage door sending sensor is showing a yellow light and the other does not show a green light -it is likely they are misaligned.";i:16;s:49:"You may want to check the back of the motor unit.";i:17;s:71:"The back of the m